import axios from "axios";
import { Fragment, useEffect, useState } from "react";
import YoutubList1213 from "./components1213/YoutubList1213";

const YoutubeApp1213 = () => {
  console.log('YoutubeApp1213')

  const [videos, setVideos] = useState([])
  const [params, setParams] = useState({
    part: 'snippet',
    chart: 'mostPopular',
    maxResult: 25,
    key: "AIzaSyAF_QeapaYa0SO4Q4RLivzjodBExQ8HsZQ"
  })

  useEffect(() => {
    console.log('effect')
    axios.get('', { params })
    axios.get('https://www.googleapis.com/youtube/v3/videos?', { params })
      .then(result => {
        setVideos(result.data.items)
      }).catch(error => console.log(error))
  }, []) // 의존성배열리 깡통이면 최초 한번만 실행된다.
  console.log(videos)

  return (
    <Fragment>
      <YoutubList1213 videos={videos} />
    </Fragment>
  );
}

export default YoutubeApp1213;
